DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `get_rands`(IN cnt INT, IN cat VARCHAR(45))
BEGIN
  SET @temp_id = 0;
  DROP TEMPORARY TABLE IF EXISTS rands;
  CREATE TEMPORARY TABLE rands ( id INT PRIMARY KEY AUTO_INCREMENT, rand_id INT, rand_url VARCHAR(500), rand_urltitle VARCHAR(500) );

DELETE FROM cattemp;
DELETE FROM selected_url;

INSERT INTO cattemp
	SELECT @temp_id := @temp_id+1, urlid, url, urltitle, urlcat
		FROM urltable
		WHERE urlcat = cat;

loop_me: LOOP
    IF cnt < 1 THEN
      LEAVE loop_me;
    END IF;

    INSERT INTO rands(rand_id, rand_url, rand_urltitle)
       SELECT r1.urlid, r1.ct_url, r1.ct_urltitle
         FROM cattemp AS r1 JOIN
              (SELECT (RAND() *
                            (SELECT MAX(ct_urlid)
                               FROM cattemp)) AS id)
               AS r2
        WHERE r1.ct_urlid >= r2.id AND r1.urlid NOT IN (SELECT selected_urlid FROM selected_url)
        ORDER BY r1.ct_urlid ASC
        LIMIT 1;

	IF ROW_COUNT() = 1 THEN
		INSERT INTO selected_url
			SELECT rand_id
				FROM rands
				ORDER BY id DESC
				LIMIT 1;
	ELSE
		ITERATE loop_me;
	END IF;

    SET cnt = cnt - 1;
  END LOOP loop_me;
END ;;
DELIMITER ;
