CREATE DEFINER=`root`@`localhost` PROCEDURE `set_pref`(IN userid INT, IN earliesttime BIGINT)
BEGIN
DROP TEMPORARY TABLE IF EXISTS catprefs;
CREATE TEMPORARY TABLE catprefs ( id INT PRIMARY KEY AUTO_INCREMENT, urlid INT, cat INT);

INSERT INTO catprefs(urlid, cat)
	SELECT useridurlidmapper.urlid, urltable.urlcat
	FROM useridurlidmapper, urltable
	WHERE useridurlidmapper.urlid = urltable.urlid AND useridurlidmapper.userid = userid AND useridurlidmapper.timeofhit > earliesttime;

END ;;
